import React from "react";
import Signup from "../components/auth/Signup";
function onSignupListener(userData){
  console.log(userData);
}
class Auth extends React.Component{
  render(){
  return (
     <Signup onSignup={onSignupListener}/>
    );
  }
};
export default Auth;
